import React from "react";

class List extends React.Component{
    render(){
        return(
            <ul>
                <li>
                    <h2>Nom du restaurant</h2>
                    <p>Adresse du restaurant</p>
                </li>
                <li>Restaurant 2</li>
            </ul>
        );
    }
}

export default List;
